export const API_CONFIG = {
  get chatGptApiKey() {
    return chatGptApiKey;
  },
  endPoint: "https://api.openai.com/v1/chat/completions",
  modelName_Summon: "gpt-4o",
  modelName_Battle: "gpt-4o"
};

/**
 * API キーを設定（sk- で始まる形式チェック）
 * @param {string} newKey
 * @returns {boolean}
 */
export function setChatGptApiKey(newKey) {
  if (typeof newKey === "string" && newKey.startsWith("sk-") && newKey.length > 10) {
    chatGptApiKey = newKey;
    return true;
  } else {
    console.warn("[WARN] 無効なAPIキーが入力されました");
    return false;
  }
}

/**
 * ユーザー入力で API キーを設定
 * @returns {boolean}
 */
export function promptForApiKey() {
  let valid = false;
  let key;
  while (!valid) {
    key = prompt("OpenAI APIキーを入力してください:", API_CONFIG.chatGptApiKey);
    if (key === null) {
      alert("APIキーの変更をキャンセルしました");
      return false;
    }
    valid = setChatGptApiKey(key);
    if (!valid) {
      alert("無効なAPIキーです。再度入力してください。");
    }
  }
  alert("APIキーが設定されました");
  return true;
}

